import React from 'react';

const aboutStyle = `
.about-container {
  margin-top: 100px;
}

.title {
  font-size: 40px;
  font-weight: 700;
}
`;

const About = () => {
  return (
    <div>
      About
      <style>{aboutStyle}</style>
    </div>
  );
};

export default About;
